import { memo } from 'react';
import useChartUpdate from '../UseChartUpdate';
var Subtitle = /*#__PURE__*/memo(function (props) {
  useChartUpdate(props, updateSubtitle, function (chart) {
    return updateSubtitle(chart, {
      text: null
    });
  });
  return null;
});

var updateSubtitle = function updateSubtitle(chart, config) {
  chart.setTitle(undefined, config, false);
};

